import { HamburgerMenu } from "./HamburgerMenu.Styled";

export function Menu() {
  return (
    <HamburgerMenu>
      <a
        className="text-medium header-web"
        style={{
          fontSize: 25,
          marginRight: "60px",
          textDecoration: "none",
          color: ColorString.white,
          fontWeight: "bold",
          backgroundColor: ColorString.transparent,
        }}
        href="terms.html"
      >
        Terms
      </a>
    </HamburgerMenu>
  );
}
